/// @title IERC2981Royalties
/// @dev Interface for the ERC2981 - Token Royalty standard
interface IERC2981Royalties {
    /// @notice Called with the sale price to determine how much royalty
    //          is owed and to whom.
    /// @param _tokenId - the NFT asset queried for royalty information
    /// @param _value - the sale price of the NFT asset specified by _tokenId
    /// @return _receiver - address of who should be sent the royalty payment
    /// @return _royaltyAmount - the royalty payment amount for value sale price
    function royaltyInfo(uint256 _tokenId, uint256 _value)
        external
        view
        returns (address _receiver, uint256 _royaltyAmount);
}

/// @dev This is a contract used to add ERC2981 support to ERC721 and 1155
/// @dev This implementation has the same royalties for each and every tokens
abstract contract ERC2981Royalties is ERC721Enumerable, IERC2981Royalties {
    address private _royaltiesRecipient;
    uint256 private _royaltiesValue = 0;

    /// @inheritdoc	ERC165
    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721Enumerable)
        returns (bool)
    {
        return interfaceId == type(IERC2981Royalties).interfaceId || super.supportsInterface(interfaceId);
    }

    /// @dev Sets token royalties
    /// @param recipient recipient of the royalties
    /// @param value percentage (using 2 decimals - 10000 = 100, 0 = 0)
    function _setRoyalties(address recipient, uint256 value) internal {
        require(value <= 10000, 'ERC2981Royalties: Too high');
        _royaltiesRecipient = recipient;
        _royaltiesValue = value;
    }

    /// @dev Sets token royalties
    /// @param recipient recipient of the royalties
    function _setRoyaltiesReceiver(address recipient) internal {
        _royaltiesRecipient = recipient;
    }

    /// @dev Sets token royalties
    /// @param value percentage (using 2 decimals - 10000 = 100, 0 = 0)
    function _setRoyaltiesValue(uint256 value) internal {
        require(value <= 10000, 'ERC2981Royalties: Too high');
        _royaltiesValue = value;
    }

    /// @inheritdoc	IERC2981Royalties
    function royaltyInfo(uint256, uint256 value)
        external
        view
        override
        returns (address receiver, uint256 royaltyAmount)
    {
        return (_royaltiesRecipient, (value * _royaltiesValue) / 10000);
    }
}

contract MintedHistoryContract is ERC2981Royalties, Ownable {
  // Address of team to pay fee
  address payable private _team;
  // Token price - 2 AVAX
  uint256 public constant tokenPrice = 2000000000000000000 wei;
  // Maximum tokens minted: 320 but will be increased for later editions
  uint256 private _maxTokens = 320;

  // Identifies if Public Mint has started
  bool private _publicMintStarted = false;

  // Identifies if claim free is activate
  bool private _claimNFTStarted = false;

  // Array of minters address  
  address[] private _minterOf;

  // Array of available amount of address to claim 
  mapping (address => uint256) private AddressesClaimAmountFree;
  // Number of NFTs claimed by team
  uint256 private _totaldevclaimed = 0;

  constructor(string memory baseURI, address team_address) ERC721("MINTED HISTORY - Crypto History", "MHCH") {
    _setbaseURI(baseURI);

    _setRoyalties(team_address, 500);

    _team = payable(team_address);
  }

  /**
   * @dev Returns the address of the bank to send value of sale.
   */
  function team() public view virtual returns (address) {
      return _team;
  }

  /**
   * @dev Returns the address of the bank to send value of sale.
   * @param tokenId id of token 
   */
  function minterOf(uint256 tokenId) public view virtual returns (address) {
    uint256 supply = totalSupply();
    if(tokenId >= supply){
      return address(0);
    }
    return _minterOf[tokenId];
  }

  /**
   * @dev Returns if public mint is started.
   */
  function publicMintStarted() public view virtual returns (bool) {
      return _publicMintStarted;
  }

  /**
   * @dev Returns if free mint is started.
   */
  function claimNFTStarted() public view virtual returns (bool) {
      return _claimNFTStarted;
  }

    function maxTokens() public view virtual returns (uint256) {
        return _maxTokens;
    }

  /**
   * @dev Return all tokenID's of address
   * @param _owner is address to be searched  
   */
  function tokensOfOwner(address _owner) external view returns(uint256[] memory ) {
    uint256 tokenCount = balanceOf(_owner);
    if (tokenCount == 0) {
      // Return an empty array
      return new uint256[](0);
    } else {
      uint256[] memory result = new uint256[](tokenCount);
      uint256 index;
      for (index = 0; index < tokenCount; index++) {
          result[index] = tokenOfOwnerByIndex(_owner, index);
      }
      return result;
    }
  }

  /**
   * @dev Mint Function
   */
  event Request(address to, uint256 value);

  function MintNft() public payable {
    require(_publicMintStarted, "Public Mint not started!");

    uint256 mintIndex = totalSupply();
    uint256 remain_mint = _maxTokens-mintIndex;
    require(remain_mint != 0, "No more NFTs to Mint!");

    require(tokenPrice == msg.value, "Avax amount not correct");

    //Send to team 2.0 AVAX
    (bool success, ) = _team.call{value: tokenPrice}("");
    require(success, "Contract execution Failed");

    address minter = _msgSender();

    //Mint
    _safeMint(minter, mintIndex);
    emit Request(minter, msg.value);
  }

  function getAvailable_to_Claim(address user) public view returns (uint256 user_balance) {
    uint256 balance = AddressesClaimAmountFree[user];
    return balance;
  }

  /**
   * @dev Claim free NFT for Early Birders
   */
  function claimArticles() public {
    require(_claimNFTStarted, "Period for claim not started!");
    uint256 available_to_claim = getAvailable_to_Claim(_msgSender());
    require(available_to_claim > 0, "No NFT to claim!");

    uint256 mintIndex = totalSupply();
    uint256 remain_mint = _maxTokens-mintIndex;
    require(remain_mint != 0, "No NFT to claim!");

    if((available_to_claim + mintIndex ) > _maxTokens){
      //Mint remains tokens
      for (uint256 index = 0; index < remain_mint; index++) {
        _safeMint(_msgSender(), mintIndex);
        _minterOf.push(_msgSender());
        mintIndex++;
      }
      AddressesClaimAmountFree[_msgSender()] = 0;
      emit Request(_msgSender(), 0);
      return;
    }

    for (uint256 index = 0; index < available_to_claim; index++) {
      _safeMint(_msgSender(), mintIndex);
      _minterOf.push(_msgSender());
      mintIndex++;
    }
    AddressesClaimAmountFree[_msgSender()] = 0;
    emit Request(_msgSender(), 0);
  }

  // Only Owner Functions
  /**
   * @dev start public mint
   */
  function startPublicMint() public onlyOwner {
    require(_publicMintStarted == false, "Public mint has already begun");
    _publicMintStarted = true;
  }

  /**
   * @dev pause public mint
   */
  function pausePublicMint() public onlyOwner {
    require(_publicMintStarted == true, "Public mint is paused");
    _publicMintStarted = false;
  }

    /**
    * @dev change Max Tokens
     */
     function changeMaxTokens(uint256 newMaxTokens) public onlyOwner {
         require(newMaxTokens > _maxTokens, "New Max must be greater than previous Max");
         _maxTokens = newMaxTokens;
     }

  /**
   * @dev start Claim
   */
  function startClaimNFT() public onlyOwner {
    require(_claimNFTStarted == false, "Period of claim free nft has already begun");
    _claimNFTStarted = true;
  }

  /**
   * @dev pause Claim
   */
  function pauseClaimNFT() public onlyOwner {
    require(_claimNFTStarted == true, "Period of claim free nft is paused");
    _claimNFTStarted = false;
  }

  /**
   * @dev Claim free NFT
   */
  function devClaim() public onlyOwner{
    uint256 mintIndex = totalSupply();
    uint256 remain_mint = _maxTokens-mintIndex;
    require(remain_mint != 0, "No NFT to claim!");

    require(_totaldevclaimed +1 <= 250, "No NFT to claim!");

    if((25 + mintIndex ) > _maxTokens){
      //Mint remains tokens
      for (uint256 index = 0; index < remain_mint; index++) {
        _safeMint(owner(), mintIndex);
        _minterOf.push(owner());
        mintIndex++;
      }
      emit Request(owner(), 0);
      _totaldevclaimed = 250;
      return;
    }
    for (uint256 index = mintIndex; index < mintIndex+25; index++) {
      _safeMint(owner(), index);
      _minterOf.push(owner());
    }
    _totaldevclaimed += 25;
    emit Request(owner(), 0);
  }

    /**
    * @dev Set Token URI once uploaded 
    */
    function setTokenUri(uint256 tokenId, string memory tokenUri) public onlyOwner {
        _setTokenURI(tokenId, tokenUri);
    }

  /**
   * @dev Add address to free mint NFT
   */
  function add_freeminters(address[] memory early_birders, uint256[] memory balance_early_birders) public onlyOwner{
    // Add early birders to whitelist 
    for (uint256 index = 0; index < early_birders.length; index++) {
      address _account = early_birders[index];
      uint256 _balance_claim = balance_early_birders[index];
      AddressesClaimAmountFree[_account] = _balance_claim;
    }
  }

  /**
   * @dev set base uri of tokens
   * @param baseURI new base uri
   */
  function setBaseURI(string memory baseURI) public onlyOwner{
      _setbaseURI(baseURI);
  }
  /**
   * @dev set percentage of royalties
   * @param value new percentage value
   */
  function setRoyaltiesValue(uint256 value) public onlyOwner{
      _setRoyaltiesValue(value);
  }

  function setRoyaltiesAddress(address newReceiver) public onlyOwner{
      _setRoyaltiesReceiver(newReceiver);
  }
}

